import axios from "axios";
import { API } from "../utils/config";

export const insertCustomer = (data) => {
    alert(`${Object.keys (data)} = ${Object.values(data)}`);
        return axios.post(`${API}/customer`, data, {
        headers: {
            "Content-Type": "application/json",
        }
    })
}
